import React from "react";
import Form from "./Form";

var userIsRegistered = true;
function Update(){
  if(userIsRegistered){
    return(
    <Form />
    )
  }
  else{
    return(
      <div>
<Form />
    <input type="password" placeholder="Confirm Password" />
    <button type="submit">Register</button>
    </div>

    )

  }
}

function App() {
  return (
    <div className="container">
    {Update()}
    </div>
  );
}

export default App;
